import React from 'react';
import Chart from "./Chart"


function Main(){

    // useEffect(() => {
    //     $(function() {
    //         $('.chart').easyPieChart({
    //             size: 250,
    //             barColor: "#6E89FF",
    //             scaleLength: 0,
    //             lineWidth: 30,
    //             trackColor: "#E3E3E3",
    //             lineCap: "circle",
    //             animate: 2000,
    //         });
    //     });
    //     // const status = useScript("https://cdnjs.cloudflare.com/ajax/libs/jquery/3.3.1/jquery.min.js");
    //     // const status2 = useScript("https://cdnjs.cloudflare.com/ajax/libs/easy-pie-chart/2.1.6/jquery.easypiechart.min.js");
    //     // if(status === "ready") {
            
    //     //    if(status2 === "ready"){
    //     //     $(function() {
    //     //         $('.chart').easyPieChart({
    //     //             size: 250,
    //     //             barColor: "#6E89FF",
    //     //             scaleLength: 0,
    //     //             lineWidth: 30,
    //     //             trackColor: "#E3E3E3",
    //     //             lineCap: "circle",
    //     //             animate: 2000,
    //     //         });
    //     //     });
    //     //    }
            
    //     // }
    // },[]);

    const data = [
        { name: 'CRI', value: 40 },
        { name: 'Group B', value: 60 },
    ];

    const setValue =(obj) =>{
        let range = obj.target.value;
        // console.log(range);

    }

    return(
        <div className='background'>
            <div className='dashboard'>
                <div className='title'>DashBoard</div>
                <div className='dashboard-content'>
                    <div className='cri'>
                        <p>CRI</p>
                        <h4>연색지수</h4>
                        <hr></hr>
                        <div class="box">
                            <Chart/>
                        </div>
                    </div>
                    <section>
                        <div className='cct'>
                            <p>CCT</p>
                            <h4>색온도</h4>
                            <hr></hr>
                            <h3>100<span>K</span></h3>
                        </div>
                        <div className='illum'>
                            <p>illumination</p>
                            <h4>조도</h4>
                            <hr></hr>
                            <h3>100<span>LUX</span></h3>
                        </div>
                    </section>
                </div>
            </div>
            <div className='control'>
                <div className='title'>Control</div>
                <div className='control-box'>
                    <section className='light'>
                        <h4>조명</h4>

                        <div className="light-ctl">
                            <div className="radio-checked">
                                <div className="radio-checked_highlight"></div>
                                    <div className="radio-checked_container">
                                    <input className="radio-checked_input" id="on" name="status" type="radio" value="on"/>
                                    <label className="radio-checked_label radio-checked_label--on" for="on"> On</label>
                                    <input className="radio-checked_input" id="off" name="status" type="radio" value="off" />
                                    <label className="radio-checked_label radio-checked_label--off" for="off">Off</label>
                                    </div>
                            </div>
                        </div>
                    </section>

                    <section className='cct-ctl'>
                        <h4>색온도(K)</h4>
                        
                        <div className="range">
                            <input id="range_cct" type="range"  min="3000" max="5000" step="100"></input>
                            <div className='range__ticks'>
                                <span className="range__tick"><span className ="range__tick-text">3000</span></span>
                                <span className="range__tick"><span className ="range__tick-text">4000</span></span>
                                <span className="range__tick"><span className ="range__tick-text">5000</span></span>
                            </div>
                        </div>
                    </section>
                    <section className='illum-ctl'>
                        <h4>조도(LUX)</h4>
                        
                        <div className="range">
                            <input id="range_illum" type="range" min="1000" max="1200" step="10"  onChange={(e)=>setValue(e)}></input>
                            <div className='range__ticks'>
                                <span className="range__tick"><span className ="range__tick-text">1000</span></span>
                                <span className="range__tick"><span className ="range__tick-text">1100</span></span>
                                <span className="range__tick"><span className ="range__tick-text">1200</span></span>
                            </div>
                        </div>
                    </section>
                </div>
                    
            </div>
        </div>
    )

}

export default Main;
